import axios from 'axios';
import { Card, CardContent, Tooltip, Typography } from '@mui/material';
import React, { useEffect, useState } from 'react';
import { BarChart, Bar,CartesianGrid, Legend, ResponsiveContainer, XAxis, YAxis } from 'recharts';

const TotalDurationChart=()=>{
    const [data,setData]=useState([])
    const[error,setError]=useState(null)

    useEffect(()=>{
        const fetchData = async () => {
            try{
                const response = await axios.get("http://localhost:8080/analytics/durations");
                const durations = response.data.map((item,index)=>({
                    id: index+1,
                    duration: item.duration,
                }));
                setData(durations);
            } catch(err){
                setError("Failed to fetch Data")
            }
        }
        fetchData();

    },[])

    return (
        <Card>
            <CardContent>
                <Typography variant='h6'>Call Duration</Typography>
                {error&&<Typography color="error">{error}</Typography>}
                <ResponsiveContainer width="100%" height={400}>
                    <BarChart data={data} margin={{ top: 20, right: 30, left: 20, bottom: 5 }} >
                        <CartesianGrid strokeDasharray="3 3" />
                            <XAxis dataKey="id" label={{value:'Call ID',position:'center',offSet: -5}}/>
                            <YAxis label={{ value: 'Duration (s)', angle: -90, position: 'insideLeft' }}/>
                            <Tooltip />
                            <Legend />
                            <Bar dataKey="duaration" fill="blue" />
                        
                    </BarChart>
                </ResponsiveContainer>
            </CardContent>
        </Card>
    )
}

export default TotalDurationChart;
